import React from 'react';
import { Route } from 'react-router-dom';
import store from '../redux/store.js';

function PrivateRoute({ component: Component, ...rest }) {
  console.log(store);
  return(
    <Route {...rest} render={(props) => (
      <Component {...props} />
    )}
    />
  );
}

export default PrivateRoute;
